import React from 'react';
import country from './Images/OUIU.png' ;
import SimpleImageSlider from "react-simple-image-slider";



const Country=()=>{
    return (
       <>
<div className="container-fluid">
    <div className="row">
        <div className="country">
        <slide>
        <div>
            <img src={country}/>
        </div>
        

        </slide>
           
        </div>
    </div>
</div>
</>
    );
};
export default Country;
